import { Box, Grid } from '@mui/material';
import '../../style/footer.css';

function Footer() {
  return (
    <footer className="footer">
      <Box
        sx={{
          width: '100%',
          height: 300,
          backgroundColor: 'primary.dark'
        }}
      />
    </footer>
  );
}
export { Footer };
